const ProductsPage = () => {
  return (
    <Fragment>
      <h1>The Products Page.</h1>
      <ul>
        <li>Product 1</li>
        <li>Product 2</li>
        <li>Product 3</li>
      </ul>
    </Fragment>
  );
};

export default ProductsPage;
